import React from "react";
import '../App.css';
import CreateRace from './CreateRace';
import SingUp from './SingUp';

function Home() {
  return (
    <div className="Page">
    <div className="App">
      <div className="main">
          <CreateRace/>
          <SingUp/>
      </div>
    </div>
    </div>
  );
}

export default Home;
